fields.description:
I created the following unit test to restart master repeatedly in [ReplicatedLevelDBBrokerTest.java|https://github.com/apache/activemq/blob/master/activemq-leveldb-store/src/test/java/org/apache/activemq/leveldb/test/ReplicatedLevelDBBrokerTest.java]. Occasionally it hung up and reported "Not enough cluster members have reported their update positions yet.". It can't be re-produced every time as it depends largely on timing.

I think it happened due to an issue of [hawtdispatch-transport|https://github.com/fusesource/hawtdispatch]. I have created a [pull request | https://github.com/fusesource/hawtdispatch/pull/33] for that. The issue caused the "next" callback of [wal_session_copy.transport.stop(next)|https://github.com/apache/activemq/blob/master/activemq-leveldb-store/src/main/scala/org/apache/activemq/leveldb/replicated/SlaveLevelDBStore.scala#L154] not being triggered.

I'm not sure when the pull request will be merged and released as hawtdispatch-transport doesn't seem to be maintained actively. That would be great if some work-around could be done in ActiveMQ.

{code:title=ReplicatedLevelDBBrokerTest.java|borderStyle=solid}
@Test(timeout = 1000*60*10)
    public void test() throws Throwable {
    	boolean jmx = false;

        try {
            System.out.println("======================================");
            System.out.println("1.	Start 3 activemq nodes.");
            System.out.println("======================================");
            startBrokerAsync(createBrokerNode("node-1"));
            startBrokerAsync(createBrokerNode("node-2"));
            startBrokerAsync(createBrokerNode("node-3"));

            BrokerService master = waitForNextMaster();
            System.out.println("======================================");
            System.out.println("2.	Push a message to the master and browse the queue");
            System.out.println("======================================");
            sendMessage(master, pad("Hello World #1", 1024));
            assertEquals(1, browseMessages(master, jmx).size());

            int times = 200; 
            System.out.println("iteration " + times + " times.");
            for (int i = 0; i < times; i++) {
	            System.out.println("======================================");
	            System.out.println( i  + ".3.	Restart master node");
	            System.out.println("======================================");
	            stop(master);
	            brokers.remove(master);
	            master = createBrokerNode(master.getBrokerName());
	            startBrokerAsync(master);
	            master = waitForNextMaster();

	            System.out.println("======================================");
	            System.out.println(i + ".4.	Browse the queue on new master");
	            System.out.println("======================================");
	            assertEquals(1, browseMessages(master, jmx).size());
	            System.out.println("======================================");
	            System.out.println(i + ".5.	Found");
	            System.out.println("======================================");
            }

        } catch (Throwable e) {
            e.printStackTrace();
            throw e;
        }

    }
{code}

